import React, { Component, useState } from "react";
import "./App.css";
import Navbar from "./component/navbar";


class App extends Component {

  state = {}
  onGet = (e) => {
    this.setState({e})
    console.log(this.state);
  };

  render() {
    return (
      <div className="App">
        <Navbar onGet={this.onGet} />
      </div>
    );
  }
}

export default App;
